function Social() {
    var arr = ["Face book","yahoo" ,"twitter" ];
    var u_l = `<ul>`;
    for(let i = 0 ;i < 3; i ++){
      u_l+=`<li>
      <input type = "checkbox"></input>
      <label>${arr[i]}</label>
    </li>`
    } 
    u_l +=`</ul>`
    return (
        {u_l}
    );
  }
  
  export default  Social;
